import React, { useState } from 'react';
import './ContentWindow.css';

function ContentWindow() {
    const [projects, setProjects] = useState([
        {
            id: 'project-1',
            imageSrc: 'images/project1.jpg',
            title: 'Project 1',
            description: 'A brief description of Project 1.'
        },
        {
            id: 'project-2',
            imageSrc: 'images/project2.jpg',
            title: 'Project 2',
            description: 'A brief description of Project 2.'
        }
    ]);

    const createTile = (id, imageSrc, title, description) => {
        return (
            <div className="tile" id={id} key={id}>
                <img src={imageSrc} alt={title} />
                <h2>{title}</h2>
                <p>{description}</p>
            </div>
        );
    };

    return (
        <main className="content-window">
            <section className="ai-presentation">
                <p id="ai-text">Welcome! Click on a project tile to learn more about it.</p>
            </section>
            <section className="project-tiles">
                {projects.map((project) => createTile(project.id, project.imageSrc, project.title, project.description))}
            </section>
        </main>
    );
}

export default ContentWindow;
